import { Injectable } from '@nestjs/common';
import path from 'path';
import PdfPrinter from 'pdfmake';
import { CreateInvoiceDto } from './dto/create-invoice.dto';
import { calcularPrecio, calcularPrecioOpcional, getCaracteristicas, getTotalOpcionales } from 'src/common/utils';
import { INVOICE } from 'src/common/constants';

@Injectable()
export class InvoiceService {
  async generateInvoice(data: CreateInvoiceDto): Promise<Buffer> {
    const fontsDir =
      process.env.NODE_ENV === 'production'
        ? path.resolve(process.cwd(), 'dist/fonts')
        : path.resolve(process.cwd(), 'src/fonts');

    const fonts = {
      Roboto: {
        normal: path.join(fontsDir, 'Roboto_Condensed-Regular.ttf'),
        bold: path.join(fontsDir, 'Roboto_Condensed-Bold.ttf'),
        italics: path.join(fontsDir, 'Roboto_Condensed-Italic.ttf'),
        light: path.join(fontsDir, 'Roboto_Condensed-Light.ttf'),
        bolditalics: path.join(fontsDir, 'Roboto_Condensed-BoldItalic.ttf'),
      },
    };

    const printer = new PdfPrinter(fonts);

    const logo_64 =
      'data:image/png;base64,';
    const bg_64 =
      'data:image/png;base64,';
    const whatsapp =
      'data:image/png;base64,';

    const docDefinition: any = {
      pageMargins: [40, 40, 40, 74],
      background: {
        image: bg_64,
        width: 595,
        height: 842,
      },
      compress: true,
      content: [
        {
          columns: [
            {
              width: '20%',
              stack: [
                {
                  image: logo_64,
                  width: 90,
                  margin: [0, 4, 0, 0],
                },
              ],
            },
            {
              width: '80%',
              stack: [
                {
                  text: data.empresa,
                  style: 'title',
                  margin: [0, 0, 0, 8],
                },

                {
                  text: `Fecha: ${data.fecha}`,
                  style: 'small',
                },

                {
                  columns: [
                    {
                      width: '50%',
                      stack: [
                        { text: 'De', style: 'sectionHeader' },
                        {
                          text: INVOICE.NAME,
                          style: 'sectionSubtitle',
                        },
                        {
                          text: INVOICE.DEFAULT_PLACE,
                          style: 'sectionText',
                          light: true,
                        },
                        {
                          text: INVOICE.DEFAULT_EMAIL,
                          style: 'sectionText',
                          light: true,
                        },
                      ],
                    },
                    {
                      width: '50%',
                      stack: [
                        { text: 'Para', style: 'sectionHeader' },
                        { text: data.para.nombre, style: 'sectionSubtitle' },
                        { text: data.para.ciudad, style: 'sectionText' },
                        { text: data.cliente.email, style: 'sectionText' },
                      ],
                    },
                  ],
                  margin: [0, 20, 0, 20],
                },
                {
                  stack: [
                    {
                      table: {
                        headerRows: 1,
                        widths: ['60%', '40%'],
                        body: [
                          [
                            {
                              text: 'Website',
                              bold: true,
                              color: '#FFFFFF',
                              alignment: 'center',
                            },
                            {
                              text: 'Precio',
                              bold: true,
                              color: '#FFFFFF',
                              alignment: 'center',
                            },
                          ],
                          [
                            {
                              ul: getCaracteristicas(data.tipo_cotizacion, data.tipo_desarrollo),
                              margin: [0, 5, 0, 5],
                              color: '#FFFFFF',
                            },
                            {
                              stack: getCaracteristicas(data.tipo_cotizacion, data.tipo_desarrollo).map(
                                (caracteristica, i) => {
                                  return {
                                    text: '-',
                                    alignment: 'center',
                                    fontSize: 12,
                                    color: '#FFFFFF',
                                    margin: [0, 2, 0, 2],
                                  };
                                },
                              ),
                            },
                          ],
                        ],
                      },
                      layout: {
                        hLineWidth: function (i, node) {
                          if (i === 1) return 1;
                          if (i === 0 || i === node.table.body.length) return 1;
                          return 0;
                        },
                        vLineColor: () => '#4D4D4D',
                        hLineColor: () => '#4D4D4D',
                        vLineWidth: () => 1,
                      },
                      margin: [0, 10, 0, 12],
                    },
                    {
                      table: {
                        widths: ['60%', '40%'],
                        body: [
                          [
                            {
                              text: 'Total',
                              margin: [0, 5, 0, 5],
                              color: '#FFFFFF',
                              alignment: 'center',
                            },
                            {
                              text: `${data.moneda == 'PEN' ? INVOICE.PEN : INVOICE.USD}${calcularPrecio(
                                data.tipo_cotizacion,
                                data.tipo_desarrollo,
                                data.descuento,
                                data.porcentaje_descuento,
                              ).toLocaleString('es-PE', {
                                minimumFractionDigits: 2,
                              })}`,
                              alignment: 'center',
                              bold: true,
                              fontSize: 12,
                              color: '#FFFFFF',
                              margin: [0, 5, 0, 5],
                            },
                          ],
                        ],
                      },
                      layout: {
                        hLineWidth: function (i, node) {
                          if (i === 1) return 1;
                          if (i === 0 || i === node.table.body.length) return 1;
                          return 0;
                        },
                        vLineColor: () => '#4D4D4D',
                        hLineColor: () => '#4D4D4D',
                        fillColor: '#282828',
                        vLineWidth: () => 1,
                      },
                      margin: [0, 10, 0, 0],
                    },
                  ],
                  margin: [0, 10, 0, 0],
                },

                ...(data.opcionales
                  ? [
                      {
                        table: {
                          headerRows: 1,
                          widths: ['60%', '40%'],
                          body: [
                            [
                              {
                                text: 'Opcional',
                                bold: true,
                                color: '#FFFFFF',
                                alignment: 'center',
                              },
                              {
                                text: 'Precio',
                                bold: true,
                                color: '#FFFFFF',
                                alignment: 'center',
                              },
                            ],
                            [
                              {
                                ul: data.opcionales.caracteristicas,
                                margin: [0, 5, 0, 5],
                                color: '#FFFFFF',
                              },
                              {
                                stack: data?.opcionales?.caracteristicas.map(
                                  (caracteristica, i) => {
                                    return {
                                      text: `+ ${calcularPrecioOpcional({
                                        precioBase:
                                          data?.opcionales!.precios[i],
                                        moneda: data.moneda,
                                        tipoCambio: INVOICE.DOLLAR_PRICE,
                                        descuento: data.descuento,
                                        porcentajeDescuento: data.porcentaje_descuento,
                                      })}
`,
                                      alignment: 'center',
                                      fontSize: 12,
                                      color: '#883FFF',
                                      margin: [0, 2, 0, 2],
                                    };
                                  },
                                ),
                              },
                            ],
                          ],
                        },
                        layout: {
                          hLineWidth: function (i, node) {
                            if (i === 1) return 1;
                            if (i === 0 || i === node.table.body.length)
                              return 1;
                            return 0;
                          },
                          vLineColor: () => '#4D4D4D',
                          hLineColor: () => '#4D4D4D',
                          vLineWidth: () => 1,
                        },
                        margin: [0, 40, 0, 12],
                      },
                      {
                        table: {
                          widths: ['60%', '40%'],
                          body: [
                            [
                              {
                                text: 'Total',
                                margin: [0, 5, 0, 5],
                                color: '#FFFFFF',
                                alignment: 'center',
                              },
                              {
                                text: `+ ${data.moneda == 'PEN' ? INVOICE.PEN : INVOICE.USD}${getTotalOpcionales(
                                  data,
                                ).toLocaleString('es-PE', {
                                  minimumFractionDigits: 2,
                                })}`,
                                alignment: 'center',
                                bold: true,
                                fontSize: 12,
                                color: '#883FFF',
                                margin: [0, 5, 0, 5],
                              },
                            ],
                          ],
                        },
                        layout: {
                          hLineWidth: function (i, node) {
                            if (i === 1) return 1;
                            if (i === 0 || i === node.table.body.length)
                              return 1;
                            return 0;
                          },
                          vLineColor: () => '#4D4D4D',
                          hLineColor: () => '#4D4D4D',
                          fillColor: '#282828',
                          vLineWidth: () => 1,
                        },
                        margin: [0, 10, 0, 0],
                      },
                    ]
                  : []),
              ],
            },
          ],
          margin: [0, 0, 0, 0],
        },
      ],

      footer: function () {
        return {
          table: {
            widths: ['80%', '*'],
            body: [
              [
                {
                  stack: [
                    {
                      text: '¿Preguntas?',
                      style: 'footerPrompt',
                      margin: [40, 10, 0, 5],
                    },
                    {
                      text: INVOICE.DATOS_AAKASH,
                      style: 'footer',
                      margin: [40, 0, 0, 3],
                    },
                    {
                      text: INVOICE.DATOS_SAGAR,
                      style: 'footer',
                      margin: [40, 0, 0, 10],
                    },
                  ],
                  border: [false, false, false, false],
                },
                {
                  image: whatsapp,
                  width: 20,
                  border: [false, false, false, false],
                  margin: [0, 25, 0, 0],
                },
              ],
            ],
          },
          fillColor: '#282828',
          margin: [0, 0, 0, 0],
        };
      },

      styles: {
        title: { fontSize: 18, color: '#ffffff' },
        sectionHeader: { fontSize: 14, margin: [0, 0, 0, 5], color: '#ffffff' },
        sectionSubtitle: {
          fontSize: 12,
          margin: [0, 0, 0, 5],
          color: '#ffffff',
        },
        sectionText: {
          fontSize: 11,
          margin: [0, 0, 0, 5],
          color: '#DADADA',
          light: true,
        },
        small: { fontSize: 10, color: '#999999' },
        footerPrompt: { fontSize: 14, color: '#FFFFFF' },
        footer: { fontSize: 10, color: '#999999' },
      },
    };

    const pdfDoc = printer.createPdfKitDocument(docDefinition);
    const chunks: any[] = [];

    return new Promise((resolve, reject) => {
      pdfDoc.on('data', (chunk) => chunks.push(chunk));
      pdfDoc.on('end', () => resolve(Buffer.concat(chunks)));
      pdfDoc.on('error', reject);
      pdfDoc.end();
    });
  }
}
